var yieldTypes = function (graph) {
    var types = {};
    for ( var t in graph.data) {
        var settype = "normal";
        if (graph.data[t]["__"].isRootNode === true ) {
            settype = "root";
        } else if ( graph.data[t]["__"].isProgramNode === true ) {
            settype = "program";
        } else if ( graph.data[t]["__"].isAggregateCaseObj === true ) {
            settype = "aggregateCaseObj";
        } else {
            // this is a workaround to find out whether a node is an aggregator
            for ( var x in graph.data[t] ) {
                if(graph.data[t][x].hasOwnProperty("0")) {
                    var count = 0;
                    for ( var x in graph.data[t][x]["0"]) {
                        if (x === "staticMembers") {
                            count++;
                        }
                        else if (x === "matterNumber") {
                            count++;
                        }
                        else if (x === "DJType") {
                            count++;
                        }
                        else if (x === "title") {
                            count++;
                        }
                        else if (count > 3) {
                            settype =  "aggregateCaseObj";
                        }
                    }
                }
            }
        }
        types[ graph.data[t]["__"].id ] = settype;
    }
    return types;
}

